import "bootstrap/dist/css/bootstrap.min.css";
import styled from "styled-components";

import { Routes, Route, Link } from "react-router-dom";
import { Button, Navbar, Container, Nav, Row, Col } from "react-bootstrap";

import Appbars from "./components/appbars.js";
import Searchbox from "./components/searchbox.js";
import Musiccontroller from "./components/musiccontroller.js";
import Feedswrap from "./components/feedswrap.js";

import Login from "./route/login.js";
import Register from "./route/register.js";
import Mainpage from "./route/mainpage.js";

let CenterBox = styled.div`
  text-align: center;
`;

let MainWrap = styled.div`
  // max-width: 1300px;
  margin: auto;
  // background: #00457e;
  background: #bbd2ec;
  padding: 1rem;
`;

let PlayerBox = styled.div`
  float: left;
  border-radius: 1rem;
  background: #003a88;
  color: white;
  padding: 0.5rem;
  margin: 1rem;
  box-shadow: 0.2rem 0.2rem 1rem black;
`;

function App() {
  return (
    <>
      <Appbars></Appbars>
      <Routes>
        <Route path="/" element={<div>메인페이지</div>} />
        <Route path="/login" element={<Login></Login>} />
        <Route path="/register" element={<Register></Register>} />
      </Routes>
    </>
  );
}

export default App;
